public class ProcessMonitoringSystemTest {

    // Placeholder classes as static nested classes
    static class ProcessMonitoringSystem {
        public ConfigurationInterface getConfigurationInterface() {
            return new ConfigurationInterface();
        }

        public void cleanupResources() {
            System.out.println("ProcessMonitoringSystem resources cleaned up.");
        }
    }

    static class ConfigurationInterface {
        private Duration durationLimit;
        private Object timeoutSettings;
        private boolean threadManagementConfiguredAsProper = true;

        public MonitoringComponent buildMonitoringComponent() {
            MonitoringComponent component = new MonitoringComponent();
            component.setDurationLimit(this.durationLimit);
            component.setProperThreadManagement(this.threadManagementConfiguredAsProper);
            component.setActiveMonitoringMechanism(false);
            return component;
        }

