            this.durationLimit = duration;
        }

        public void setThreadManagementSettings(Object settings) {
            this.threadManagementConfiguredAsProper = true;
        }
    }

    static class MonitoringComponent {
        private boolean activeMonitoringMechanism;
        private Duration durationLimit;
        private boolean properThreadManagement;

        public boolean hasActiveMonitoringMechanism() {
            return activeMonitoringMechanism;
        }

        public void setActiveMonitoringMechanism(boolean activeMonitoringMechanism) {
            this.activeMonitoringMechanism = activeMonitoringMechanism;
        }

        public Duration getDurationLimit() {
            return durationLimit;
        }

        public void setDurationLimit(Duration durationLimit) {
            this.durationLimit = durationLimit;
        }

        public boolean hasProperThreadManagement() {
            return properThreadManagement;
        }

        public void setProperThreadManagement(boolean properThreadManagement) {
            this.properThreadManagement = properThreadManagement;
        }
    }

    private ProcessMonitoringSystem monitoringSystem;
    private ConfigurationInterface configurationInterface;

    @BeforeEach
    void setUp() {
        monitoringSystem = new ProcessMonitoringSystem();
        configurationInterface = monitoringSystem.getConfigurationInterface();
    }

    @AfterEach
    void tearDown() {
        if (monitoringSystem != null) {
            monitoringSystem.cleanupResources();
        }
    }

    @Test
    void testProcessMonitoringConfigurationScenarios() {
