        MonitoringComponent basic_monitoring_component = configurationInterface.buildMonitoringComponent();
        assertNotNull(basic_monitoring_component);
        assertFalse(basic_monitoring_component.hasActiveMonitoringMechanism());

        // Scenario 2: Configure system with missing timeout settings
        configurationInterface.setTimeoutSettings(null);
        MonitoringComponent component_missing_timeout = configurationInterface.buildMonitoringComponent();
        assertNotNull(component_missing_timeout);

        // Scenario 3: Configure system with a specific duration limit of one minute
        configurationInterface.setDurationLimit(Duration.ofMinutes(1));
