public class ExecuteWatchdogBuilderTest {

    @Test
    void testBuilderAssertions() {
        // Assertion Chain 1: Verify a basic ExecuteWatchdog instance is not null
        ExecuteWatchdog executeWatchdogInstance1 = ExecuteWatchdog.builder().get();
        assertNotNull(executeWatchdogInstance1);

        // Assertion Chain 2: Verify the internal Watchdog object is null when no timeout is configured
        ExecuteWatchdog executeWatchdogInstance2 = ExecuteWatchdog.builder().get();
        Watchdog watchdogObject1 = executeWatchdogInstance2.getWatchdog();
        assertNull(watchdogObject1);

        // Assertion Chain 3: Verify an ExecuteWatchdog instance is created even with a null timeout
        ExecuteWatchdog executeWatchdogInstance3 = ExecuteWatchdog.builder().setTimeout(null).get();
        assertNotNull(executeWatchdogInstance3);

        // Assertion Chain 4: Verify the configured timeout duration
        Duration oneMinuteDuration = Duration.ofMinutes(1L);
        ExecuteWatchdog executeWatchdogInstance4 = ExecuteWatchdog.builder().setTimeout(oneMinuteDuration).get();
        Watchdog watchdogObject2 = executeWatchdogInstance4.getWatchdog();
        Duration configuredTimeoutDuration = watchdogObject2.getTimeout();
        assertEquals(oneMinuteDuration, configuredTimeoutDuration);

        // Assertion Chain 5: Verify an ExecuteWatchdog instance is created with a null thread factory
        ExecuteWatchdog executeWatchdogInstance5 = ExecuteWatchdog.builder().setThreadFactory(null).get();
        assertNotNull(executeWatchdogInstance5);

        // Assertion Chain 6: Verify the thread factory is not null despite initial null assignment when timeout is also set
        ExecuteWatchdog executeWatchdogInstance6 = ExecuteWatchdog.builder()
                .setThreadFactory(null)
                .setTimeout(oneMinuteDuration) // Reusing oneMinuteDuration
                .get();
        Watchdog watchdogObject3 = executeWatchdogInstance6.getWatchdog();
        ThreadFactory configuredThreadFactory = watchdogObject3.getThreadFactory();
        assertNotNull(configuredThreadFactory);
    }
}

