        String singleQuotedString = "'hello'";
        String unquotedContentSingle = "hello";

        // Step 1: Invoke the quote argument method with the single-quoted string
        String processedStringSingle = StringUtils.quoteArgument(singleQuotedString);

        // Step 2: Assert that the returned value matches the unquoted content
        assertEquals(unquotedContentSingle, processedStringSingle);

        // Step 3: Prepare a string enclosed in double quotes
        String doubleQuotedString = "\"world\"";
        String unquotedContentDouble = "world";

        // Step 4: Invoke the quote argument method with the double-quoted string
        String processedStringDouble = StringUtils.quoteArgument(doubleQuotedString);

        // Step 5: Assert that the returned value matches the unquoted content
        assertEquals(unquotedContentDouble, processedStringDouble);

        // Step 6: Prepare a string containing an embedded single-quoted phrase
        String stringWithEmbeddedSingleQuotes = "This is 'a test' string";

        // Step 7: Invoke the quote argument method with the string containing embedded single quotes
        String processedStringEmbeddedSingle = StringUtils.quoteArgument(stringWithEmbeddedSingleQuotes);

        // Step 8: Assert that the result wraps the entire argument in double quotes
        assertEquals("\"This is 'a test' string\"", processedStringEmbeddedSingle);

        // Step 9: Prepare a string containing an embedded double-quoted phrase
        String stringWithEmbeddedDoubleQuotes = "This is \"another test\" string";

        // Step 10: Invoke the quote argument method with the string containing embedded double quotes
        String processedStringEmbeddedDouble = StringUtils.quoteArgument(stringWithEmbeddedDoubleQuotes);

        // Step 11: Assert that the result wraps the entire argument in single quotes
        assertEquals("'This is \"another test\" string'", processedStringEmbeddedDouble);

