        assertEquals("\"another example\"", processed_text_scenario2, "Scenario 2 failed: Should leave double-quoted strings as is.");

        // Scenario 3: Text containing internal single quotes
        String input_text_internal_single_quote = "don't do it";
        String processed_text_scenario3 = StringUtils.quoteArgument(input_text_internal_single_quote);
